@mrjamesob  Have you read Fintan O'Toole in the Guardian today?  Matches the theme of your @LBC programme today perfectly: Brexit was never about Europe!  

Veterans for Europe: if you read one newspaper article today, read this one.

#RevokeA50Now https://t.co/2bIlBmD8DH

@thomasbrake Another advantage: 
By revoking Article 50 and remaining, all of this is over. 
If we continue with May's Withdrawal Agreement, or try to get agreement to another form of Brexit, the negotiations will continue for years. #MakeItStop #RevokeA50Now

@DavoodGhadami @johnmcdonnellMP So far, all brexit supporting parties have lost support. All remain parties have gained.
How difficult is that to interpret ?
#StopBrexitSaveBritain #revokea50now #betterinthanout
